mapper.select:
select 

from TRS_FX_INTERNAL_DEAL
where BRANCH_CODE = #{BRANCH_CODE}
  and COMP_CODE = #{COMP_CODE}
  and FOREX_CREATION_TYPE = #{FOREX_CREATION_TYPE}
  and SERIAL_NO = #{SERIAL_NO}

mapper.delete:
delete from TRS_FX_INTERNAL_DEAL
where BRANCH_CODE = #{BRANCH_CODE}
  and COMP_CODE = #{COMP_CODE}
  and FOREX_CREATION_TYPE = #{FOREX_CREATION_TYPE}
  and SERIAL_NO = #{SERIAL_NO}
